import Card from "./Components/Card/card";




const Profile = () => {
    return (
        <div className="grid grid-rows-2">
            <div className="grid grid-cols-3 h-3/5">
                <Card>1</Card>
                <Card>2</Card>
                <Card>3</Card>
            </div>
            <div className="grid grid-cols-2 h-2/5">
                <Card>4</Card>
                <Card>5</Card>
            </div>
        </div>
    )
}

export default Profile;
